import React from "react";

export default class Orders extends React.Component{
    render(){
        return(
            <div>
                <h1>Orders List</h1>
                <table className="table">
                    <thead>
                        <tr>
                            <th>Order ID</th>
                            <th>Order Placer</th>
                            <th>Time Order</th>
                            <th>Total</th>
                            <th>Order Status</th>
                        </tr>
                    </thead>
                    <tbody>

                    </tbody>
                </table>
            </div>
        )
    }
}
